import React from "react";
import "./matchCard.css";
export default function MatchCard() {
  return (
    <div className="match-card-container container">
      <div className="match-card col-xl-6">
        <div className="card-content">
          <h5 className="team">Chelsea</h5>
          <div className="date-and-status">
            <span className="date">19:55</span>
            <span className="vs status">Live</span>
          </div>
          <h5 className="team">Manchester United</h5>
          <p className="league">League : PL</p>
        </div>
      </div>
    </div>
  );
}
